            </Tooltip>
         </Grid>
         <Grid item>
            <Tooltip title="LinkedIn">
               <a href="https://www.linkedin.com/in/bianca-sakaniwa/">
                  <LinkedInIcon focusable={true} sx={{ fontSize: "55px", color: "black" }} />
               </a>
            </Tooltip>
         </Grid>
         <Grid item>
            <Tooltip title="E-mail">
               <a></a>
               <EmailIcon sx={{ fontSize: "53px", color: "black" }} />
            </Tooltip>
         </Grid>
      </Grid>
   )
}
